const login = "/login";
const dashboardStats = "stats/summary";
const getAllAdmin = "/stats/admins";
const toggleAdminStatus = "/super/admin";
const getAllDataConsumers = "/customers?type=data_consumer";
const getAllDataProviders = "/customers?type=data_provider";
const toggleLiveCustomer = "/customer";
const addNewAdmin = "/super/admin";
const adminCustomerLogin = "/customer";
const getSingleAdmin = "/profile";
const getSingleCustomer = "/customer";

// admin/super/admin/12222

const UrlRoute = {
  login,
  dashboardStats,
  getAllAdmin,
  toggleAdminStatus,
  getAllDataConsumers,
  getAllDataProviders,
  toggleLiveCustomer,
  addNewAdmin,
  adminCustomerLogin,
  getSingleAdmin,
  getSingleCustomer,
};

export default UrlRoute;
